import "./Header.css";

function Header({onNav}) {
    debugger
    return (
        <header className="topnav">
            <div className="nav-area">
                <a href="/" ><img alt="" className="headerimage" src={"images/logo-image.jpg"}/>
                </a>
                <h1>Snake House</h1>
                <Navbar onNav={onNav}/>
            </div>
        </header>
    );
};

export default Header;
